    false,nt"url": null,nt"notes": "This Comprehensive Management Plan will
    provide the framework for making decisions on conserving natural, cultural, and
    recreational resources, managing visitor use, developing facilities and addressing
    administrative operations of Two Ponds National Wildlife Refuge.  The U.S. Fish
    and Wildlife Service (Service) has developed this Comprehensive Management Plan
    to provide alternatives and identify consequences for the management and use of
    Two Ponds National Wildlife Refuge. The Comprehensive Management Plan outlines issues,
    concerns and opportunities expressed to the Service during scoping meetings, public
    open houses, newsletter appeals, and other means. Topics addressed in this plan
    include; wildlife protection, habitat conservation, wilderness areas, visitor services,
    natural resources, physical environment, fire management, and Refuge administration.",nt"license_title":
